console.log("--------------Assignment 02--------------");

var num1 = 100;
var num2 = 200;
var num3 = 300;
console.log("Before Swapping...!!!");
console.log("Num1 => ", num1);
console.log("Num2 => ", num2);
console.log("Num3 => ", num3);

var temp1 = num3;
var temp2 = num1;
num1 = num2;
num2 = temp1;
num3 = temp2;

console.log("After Swapping...!!!");
console.log("Num1 =>", num1);
console.log("Num2 =>", num2);
console.log("Num3 =>", num3);


